import React from 'react';

const Homepage = () => {
	return (
		<>
			<h1>Создание записи</h1>
			<form>
				<input type='text' placeholder='Дата заявки' />
				<textarea placeholder='Оборудование' />
				<label>
					Вид неисправности
					<select>
						<option value='поломка'>поломка</option>
					</select>
				</label>
			</form>
		</>
	);
};

export default Homepage;
